import React from 'react';

const Blog = ({ data }) => (
    <div className="container">
      <h1>Blog</h1>
      <div class="row">
        {/* mapping Link URL with ID and Photos to PhotoGrid Component */}
        {data.map((info, i) => (
              <div>
                  <h1>{info.placep}</h1>
              </div>
        ))}
      </div>
    </div>
  );


export default Blog;
